         const CARD_SHADOW = {
            borderRadius: '10px',
            maxWidth : 'auto',
            'box-shadow': '0px 13px 26px rgb(109,184,241, 0.16)',
          };
          

const Hea = () => {

        return (
            <div style={CARD_SHADOW}>
                <h1> Health </h1>
            </div>
            )
        }
  

export default Hea ;
